import React, { useState } from 'react';
import IITILOGO from "./images/iitilogo.png"; 


  
export default function Left() {
  const[style,setStyle]=useState({ padding: "1rem",
                textDecoration: "none",
                color: "black",}); 
const[style1,setStyle1]=useState({ padding: "1rem",
                textDecoration: "none",
                color: "black",}); 
 const[style2,setStyle2]=useState({ padding: "1rem",
                textDecoration: "none",
                color: "black",}); 
 const[style3,setStyle3]=useState({ padding: "1rem",
                textDecoration: "none",
                color: "black",}); 
 
 
 
 
  return (
    <>
      <div className="left d-flex">
        <div
          className="firstleft d-flex"
          style={{
            flexDirection: "column",
            border: "1px solid black",
            borderRight:"0px solid transparent",
            height: "100vh",
            width: "3rem",
            backgroundColor: "rgb(59 99 139)",
          }}
        >
          <a href="#">
            <i
              class="fa-solid fa-qrcode"
              style={style}
            onMouseEnter={()=>{
     setStyle({color:"white",padding: "1rem",
                textDecoration: "none",})}}

          onMouseLeave={()=>{setStyle({color:"black",padding: "1rem",
                textDecoration: "none"})}}
></i>
          </a>
          <a href="#">
            <i
              class="fa-regular fa-user"
  style={style1}
            onMouseEnter={()=>{
     setStyle1({color:"white",padding: "1rem",
                textDecoration: "none"})}}

          onMouseLeave={()=>{setStyle1({color:"black",padding: "1rem",
                textDecoration: "none",})}}
       
            ></i>
          </a>
          <a href="#">
            <i
              class="fa-regular fa-user"
             style={style2}
            onMouseEnter={()=>{
     setStyle2({color:"white",padding: "1rem",
                textDecoration: "none",})}}

          onMouseLeave={()=>{setStyle2({color:"black",padding: "1rem",
                textDecoration: "none",})}}
           
            ></i>
          </a>
          <a href="#">
            <i
              class="fa-solid fa-table-cells"
              style={style3}
            onMouseEnter={()=>{
     setStyle3({color:"white",padding: "1rem",
                textDecoration: "none",})}}

          onMouseLeave={()=>{setStyle3({color:"black",padding: "1rem",
                textDecoration: "none",})}}
            ></i>
          </a>
        </div>
        <div
          className="secondleft d-flex"
          style={{
            flexDirection: "column",
            border: "1px solid black",
             borderLeft:"0px solid transparent",
            height: "100vh",
            width: "7rem",
            backgroundColor: "rgb(59 99 139)",
          }}
        >
          <a
            href="#"
            style={{
              padding: "0.75rem",
              textDecoration: "none",
              color: "black",
            }}
          >
            Dashboard
          </a>
          <a
            href="#"
            style={{
              padding: "0.75rem",
              textDecoration: "none",
              color: "black",
            }}
          >
            Profile
          </a>
          <a
            href="#"
            style={{
              padding: "0.75rem",
              textDecoration: "none",
              color: "black",
            }}
          >
            Enroll
          </a>
          <a
            href="#"
            style={{
              padding: "0.75rem",
              textDecoration: "none",
              color: "black",
            }}
          >
            TimeTable
          </a>
          <div className="logo">
            <img src={IITILOGO} alt="logo" style={{ width: "5rem",bottom:"0px"}} />
          </div>{" "}
        </div>
      </div>
    </>
  );
}
